import React from "react";
import LoginPage from "./loginSignup/loginPage";
import SignupPage from "./loginSignup/signupPage";
import CreateTalk from "./talkContainers/createTalk";

export const CreateTalkModal = ({ setOpen, open }) => {
  return (
    <div className=' '>
      <div className='fixed   h-2/4 bg-black rounded w-full justify-center flex flex-col '>

               <div
        className={`${
          open ? "flex" : "hidden"
        } relative top-0 right-0 z-20 w-full bg-transparent h-screen grid
         grid-cols-1 items-center `}
      >
        <button
          className='absolute top-0 right-0 mt-2 mr-8
  text-red focus:text-red-500 z-20'
          onClick={() => setOpen(false)}
        >
          X  </button>
              <CreateTalk/>
      </div>
      </div>
    </div>
  );
};

export const SignUpModal = ({ setOpen }) => {
  return (
    <div className=' '>
      <div className='relative   h-2/4 bg-black rounded w-full  flex flex-col '>
        <button
          className='absolute top-0 right-0 mt-2 mr-8
  text-red focus:text-red-500'
          onClick={() => setOpen(false)}
        >
          X
              </button>
              <SignupPage/>
      </div>
    </div>
  );
};
